import React, { useState, useEffect } from 'react';
import { NavLink } from 'react-router-dom';
import './Header.css';

function Header() {
  const [menuOpen, setMenuOpen] = useState(false);
  const [scrollPosition, setScrollPosition] = useState(0);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  useEffect(() => {
    const handleScroll = () => {
      setScrollPosition(window.pageYOffset);
    };

    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  return (
    <header className={`${menuOpen ? 'menu-open' : ''} ${scrollPosition > 50 ? 'scrolled' : ''}`}>
      <div className="container header-content">
        <h1 className="logo">
          <i className="fas fa-laptop-code"></i>
          <span className="logo-text">
            <span className="logo-text-main">IT Solutions</span>
            <span className="logo-text-sub">Architect</span>
          </span>
        </h1>
        <button className="menu-toggle" onClick={toggleMenu}>
          <i className={menuOpen ? 'fas fa-times' : 'fas fa-bars'}></i>
        </button>
        <nav className={`main-nav ${menuOpen ? 'open' : ''}`}>
          <ul>
            <li><NavLink to="/" end onClick={() => setMenuOpen(false)}><i className="fas fa-home"></i> <span>Home</span></NavLink></li>
            <li><NavLink to="/services" onClick={() => setMenuOpen(false)}><i className="fas fa-cogs"></i> <span>Services</span></NavLink></li>
            <li><NavLink to="/about" onClick={() => setMenuOpen(false)}><i className="fas fa-user"></i> <span>About</span></NavLink></li>
            <li><NavLink to="/contact" onClick={() => setMenuOpen(false)}><i className="fas fa-envelope"></i> <span>Contact</span></NavLink></li>
          </ul>
        </nav>
      </div>
    </header>
  );
}

export default Header;
